import React from 'react';
import ReactDOM from 'react-dom';


function Card(props){

    return(
        <>
        <div><img src="{imgscr}"/></div>
        <p></p>
        <h1></h1>
         <a href="" target ="_blank">Click Me </a>
        </>
    );

}


ReactDOM.render(
    <Card imgscr = "https://via.placeholder.com/150" title = "Awesome Series" sname = "Dark" link = "https://placeholder.com"/>
    ,
    document.getElementById('root')
);
